import React from 'react'
import {Link} from "react-router-dom";
import '../UserCard/UserCard.scss';
import {Container} from './Style';
import photoAlbum from '../../images/photoAlbum.png';

const TitlesAlbums = (props) => {
    const data= props.data;
  return (
    <Container>        
        <div className="card-item">
            <Link to={`/albums/${data.id}`} style={{ textDecoration: 'none', color: '#000000' }}>
                <div className="card-header">
                    <img src={photoAlbum} alt={data.title}></img>
                    <h2 className="card-name"> {data.title} </h2>
                </div>
                    <div className="card-bottomal">
                        &nbsp;                        
                    </div>
                </Link>
            </div>
    </Container>
  )
}

export default TitlesAlbums
